import HEAD from './COMPONENTS/HEAD';
import SEARCHSTRING from './COMPONENTS/SEARCHSTRING';
import SEARCHRESULT from './COMPONENTS/SEARCHRESULT';

function App() {
  return (
    <div className="App">
      <div className="container">
          <HEAD/>
          <SEARCHSTRING/>
          <SEARCHRESULT/>
      </div>
    </div>
  );
}

export default App;
